import "./Deep.css";
const Deep = () => {

<div class="circle-container">
  <button class="circle-btn">Button 1</button>
  <button class="circle-btn">Button 2</button>
  <button class="circle-btn">Button 3</button>
  <button class="circle-btn">Button 4</button>
  <button class="circle-btn">Button 5</button>
</div>
};
export default Deep;
